import React from 'react'

function Navbar() {
    const navitems=[
        {link:'Home',path:'home'},
        {link:'About',path:'about'},
        {link:'Menu',path:'menu'},
    ]

   
  return (
   <nav className=''>
    <div>
        <div>
            <a href="/"className=' font-semibold text-2xl flex item-center space-x-3' >Yavi</a>
        </div>
<ul>
    {
        navitems.map(({link,path})=>(
            <a key={link}  href={path}>{link}</a>
        ))
    }
</ul>
    </div>
   </nav>
  )
}

export default Navbar
